import Button from './button';

function Fields(props) {
  return (
		<>
			{
				props.data.map(i => {
					return (
							<div>
								<div>
									<h1>{i.title}</h1>
									<p>{i.text}</p>
								</div>
								<div>
									<button>{i.button}</button>
									<p>{i.number}</p>
								</div>
							</div>
					)
				})
			}
		</>
	)
};

export default Fields;
